import React from "react";
import { Box } from "@material-ui/core";

function TrendIcon() {
    return (
        <div>
            <Box 
            component='img'
            src='/vectors/trend.png'
            alt='trend_logo'
            />
            <p></p>
        </div>

    )
}

export default TrendIcon;
